import React from 'react';

const CampaignPerk = () => {
    return (
        <div className='bg-white shadow-1 roud'>
            <img src={defaultImage} className='h-[232px] object-cover rounded-xl' alt="" />
        </div>
    );
};

export default CampaignPerk;
